function Detail(){
    return(
        <> 
          <div className="main-bg"></div>
          <div className="container">
            <div className="row">
              {<Row md={4}>
                <Card shoes={shoes[0]} i={1} />
                <Card shoes={shoes[1]} i={2} />
                <Card shoes={shoes[2]} i={3} />
              </Row>}
            </div>
          </div></>
    )
}
